import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Form from "react-bootstrap/Form";
import InputGroup from "react-bootstrap/InputGroup";
import FormControl from "react-bootstrap/FormControl";
import Button from "react-bootstrap/Button";

const Shoppies = () => {
  return (
    <Container>
      <Row  style={{ backgroundColor: "#2A9D8F" }}>
        <Col xs={2} md={2} className="align-self-end">
          <span
            style={{
              fontSize: "50px",
              fontFamily: "Open Sans",
              color: "white",
              WebkitTextStroke: "1px F8F8F8",
              textShadow: "0px 1px 4px #23430C",
            }}
          >
            The Shoppies
          </span>
        </Col>
      </Row>
      <Container style={{display:"flex", alignContent:"center"}}>
      <InputGroup size="sm" className="mb-3 align-items-center">
    <InputGroup.Prepend>
      <InputGroup.Text id="inputGroup-sizing-sm">Small</InputGroup.Text>
    </InputGroup.Prepend>
    <FormControl aria-label="Small" aria-describedby="inputGroup-sizing-sm" />
  </InputGroup>
  </Container>
    </Container>
  );
};

export default Shoppies;
